    def runInf(self):
        latent_space = np.random.normal(0.0,1.0,args.latent_size)
        latent_space = np.reshape(latent_space,[1,args.latent_size])
        # print(latent_space.shape)
        latent_space = torch.Tensor(latent_space).to(device)
        generation = self.model.decode(latent_space)
        # print(generation.shape)
        generation = generation.cpu()
        generation = generation.detach().numpy()
        generation = np.squeeze(generation)
        # generation = np.reshape(generation, [3, 68, 68])
        generation = np.moveaxis(generation, 0, -1)
        im = Image.fromarray(np.uint8(generation * 255), 'RGB')
        qim = ImageQt(im)
        pix = QtGui.QPixmap.fromImage(qim)
        pixmap = QtGui.QPixmap(pix)
        pixmap = pixmap.scaled(300, 300, QtCore.Qt.KeepAspectRatio)
        # pix = QtGui.QPixmap.fromImage(qim)
        self.graphicLabel.setPixmap(pixmap)
        self.graphicLabel.update()
        #self.runInf()
        print(generation * 255)

    def generateImage(self):
        latent_space = list(latent_params.values())
        latent_space = np.reshape(latent_space, [1, args.latent_size])
        latent_space = torch.Tensor(latent_space).to(device)
        generation = self.model.decode(latent_space)
        #print(generation.shape)
        # generation = self.model.decode(latent_space)
        generation = generation.cpu()
        generation = generation.detach().numpy()
        generation = np.squeeze(generation)
        # generation = np.reshape(generation, [3, 68, 68])
        generation = np.moveaxis(generation, 0, -1)
        # print(generation.shape)
        im = Image.fromarray(np.uint8(generation * 255), 'RGB')
        qim = ImageQt(im)
        pix = QtGui.QPixmap.fromImage(qim)
        pixmap = QtGui.QPixmap(pix)
        pixmap = pixmap.scaled(300, 300, QtCore.Qt.KeepAspectRatio)
        # pix = QtGui.QPixmap.fromImage(qim)
        self.graphicLabel.setPixmap(pixmap)
        self.graphicLabel.update()
        print(list(latent_params.values()))

    def valuechange(self, id, val):
        #print(id, val)
        slider = id[0]

        maxMin = latent_ranges[slider]
        range = maxMin[1] - maxMin[0]
        trueVal = (range * (val / 100)) + maxMin[0]
        latent_params[self.latent_param_labels[slider]] = trueVal
        exec('self.label_%d_b.setText(str(%.2f))' % (slider, trueVal))
        self.generateImage()
        #print(latent_params[self.latent_param_labels[slider]])
        

